using ObjectiveC;using System;using SwiftSharp.Attributes;using Foundation;namespace UIKit{	//https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UILexicon_Class/index.html#//apple_ref/occ/cl/UILexicon	/// <summary>	/// A lexicon contains a read-only array of term pairs, each in a UILexiconEntry object, for use by a custom keyboard.	/// </summary>	[iOSVersion(8)]	public class UILexicon : NSObject	{		/// <summary>		/// A read-only array of term pairs for use by a custom keyboard.		/// </summary>		[iOSVersion(8)]		[Export("entries")]		public AnyObject[] Entries { get; private set; }	}}